        function getStringsInStrings(stringsArr){
            stringsArr.sort((str_a, str_b)=> str_a.localeCompare(str_b));
            for (let index = 0; index < stringsArr.length; index++) {
                const str1 = stringsArr[index];
                let lookForward=index+1;
                let stopForward=false;
                
                while (lookForward<stringsArr.length && !stopForward){
                    const str2=stringsArr[lookForward];
                    if (str2.substring(0, str1.length).localeCompare(str1)===0)
                    {
                        if (!nameInName[str1])
                            nameInName[str1]=[];
                        nameInName[str1].push(str2);
                    }
                    else
                        stopForward=true;
                    lookForward++;
                }
            }
        }

        const testLocToCity={};
        const cityToTestsLoc={};
        function makeTestLocToCityPointers(testLocArray, citiesArray){
            let testLocIndex=0;
            let cityIndex=0;
            while (cityIndex < citiesArray.length && testLocIndex<testLocArray.length)
            {
                let comparison;
                let curCity;
                let curTestLoc;
                while (
                    cityIndex < citiesArray.length && 
                    testLocIndex < testLocArray.length && 
                    comparison !== 0
                    )
                {
                    curCity = citiesArray[cityIndex];
                    curTestLoc=testLocArray[testLocIndex];
                    comparison=curTestLoc.substring(0, curCity.length).localeCompare(curCity);
                    if (comparison < 0)
                        testLocIndex++;
                    else if (comparison > 0)
                        cityIndex++;
                    else if(cityIndex<citiesArray.length-1)
                    {
                        const nextCity=citiesArray[cityIndex+1];
                        if (curTestLoc.substring(0, nextCity.length).localeCompare(nextCity)>=0)
                            {
                                comparison=false;
                                cityIndex++;
                            }
                    }
                }
                if (curCity && curTestLoc)
                {
                    testLocToCity[curTestLoc]=curCity;
                    if (!cityToTestsLoc[curCity])
                        cityToTestsLoc[curCity]=[];
                    cityToTestsLoc[curCity].push(curTestLoc);
                }
                testLocIndex++;
            }
            const noCityFound=[];
            testLocArray.forEach(testLoc => {
                if (!testLocToCity[testLoc])
                    noCityFound.push(testLoc);
            });
            noCityFound.forEach(testLocWithNoCity => {
                const testLocSplited=testLocWithNoCity.split('-');
                const probableCity=testLocSplited[0];
                citiesArray.push(probableCity);
                if (!cityToTestsLoc[probableCity])
                    cityToTestsLoc[probableCity]=[];
                cityToTestsLoc[probableCity].push(testLocWithNoCity);
                testLocToCity[testLocWithNoCity]=probableCity;
            });
        }

        function getWeekByDate(date)
        {
            const res = (date - weekDateStart) / 1000;
            const days = Math.floor(res / 86400);
            return Math.floor(days/7)+weekNumStart
        }

        function getDatesByWeek(week)
        {
            
            let weeksSinceFirst=week-weekNumStart;
            let days=weeksSinceFirst*7;
            let firstWeekDay=new Date(weekDateStart);
            firstWeekDay.setDate(firstWeekDay.getDate() + days)
            
            let firstDay=firstWeekDay.getDate();
            let firstMonth=firstWeekDay.getMonth()+1;
            let firstYear=firstWeekDay.getFullYear();

            firstWeekDay.setDate(firstWeekDay.getDate()+6);
            let lastDay=firstWeekDay.getDate();
            let lastMonth=firstWeekDay.getMonth()+1;
            let lastYear=firstWeekDay.getFullYear();

            const text=`${lastDay}/${lastMonth}/${lastYear} - ${firstDay}/${firstMonth}/${firstYear}`;
            return text;
            
        }

        function getTestLocDividedToDates(byDatesArray){
            
            const testsLocByDatesObj={};
            const overallTestsByLocObj={};
            byDatesArray.forEach(dateData=>{
                const {testsInCityByResidances, testsInCityByOutsiders, testDate_date, testDate}=dateData;
                const allTestsInCity=[...testsInCityByResidances, ...testsInCityByOutsiders];
                const testsLocObj={};
                
                allTestsInCity.forEach(test=>{
                    const {testLoc}=test;
                    if (!testsLocObj[testLoc])
                        testsLocObj[testLoc]=[];
                    testsLocObj[testLoc].push(test);
                });
                
                Object.keys(testsLocObj).map(loc=>{
                    const testsInLocation=testsLocObj[loc];
                    const reducedTestsObj={
                        positives: 0,
                        negatives: 0,
                        processing: 0,
                        disposed: 0,
                        overallTests: 0,
                        cities: {},
                        loc,
                        testDate_date
                    };
                    testsInLocation.forEach(test => {
                        const {city, result, count}=test
                        if (!reducedTestsObj.cities[city])
                            reducedTestsObj.cities[city]={
                                positives: 0,
                                disposed: 0,
                                negatives: 0,
                                processing: 0,
                                overallTests: 0
                            }
                        switchResults(reducedTestsObj.cities[city], result, count)
                        switchResults(reducedTestsObj, result, count);

                        reducedTestsObj.cities[city].overallTests+=count;
                        reducedTestsObj.overallTests+=count;
                    });

                    //add to overall loc object
                    if (!overallTestsByLocObj[loc])
                        overallTestsByLocObj[loc]={
                            positives: 0,
                            negatives: 0,
                            processing: 0,
                            disposed: 0,
                            overallTests: 0,
                            cities: {},
                            loc,
                        };
                    overallTestsByLocObj[loc].positives+=reducedTestsObj.positives;
                    overallTestsByLocObj[loc].negatives+=reducedTestsObj.negatives;
                    overallTestsByLocObj[loc].processing+=reducedTestsObj.processing;
                    overallTestsByLocObj[loc].disposed+=reducedTestsObj.disposed;
                    overallTestsByLocObj[loc].overallTests+=reducedTestsObj.overallTests;
                    
                    Object.keys(reducedTestsObj.cities).map(city=>{
                        const cityData=reducedTestsObj.cities[city];
                        if (!overallTestsByLocObj[loc].cities[city])
                            overallTestsByLocObj[loc].cities[city]={
                                    positives: 0,
                                    negatives: 0,
                                    processing: 0,
                                    disposed: 0,
                                    overallTests: 0,
                                }
                        overallTestsByLocObj[loc].cities[city].positives+=reducedTestsObj.cities[city].positives;
                        overallTestsByLocObj[loc].cities[city].negatives+=reducedTestsObj.cities[city].negatives;
                        overallTestsByLocObj[loc].cities[city].processing+=reducedTestsObj.cities[city].processing;
                        overallTestsByLocObj[loc].cities[city].disposed+=reducedTestsObj.cities[city].disposed;
                        overallTestsByLocObj[loc].cities[city].overallTests+=reducedTestsObj.cities[city].overallTests;
                    })

                    

                    const cities=[];
                    Object.keys(reducedTestsObj.cities).map(city=>{
                        cities.push({
                            city,
                            ...reducedTestsObj.cities[city]
                        })
                    })
                    cities.sort((city_a, city_b)=>city_a.city.localeCompare(city_b.city));
                    cities.sort((city_a, city_b)=>city_b.overallTests-city_a.overallTests);
                    cities.sort((city_a, city_b)=>city_b.positives-city_a.positives);
                    reducedTestsObj.cities=cities;
                    if (!testsLocByDatesObj[loc])
                        testsLocByDatesObj[loc]=[];

                    testsLocByDatesObj[loc].push({date: testDate_date, reducedTests: reducedTestsObj})
                });
            });
            const testsLocByDates=[];
            Object.keys(testsLocByDatesObj).map(loc=>{
                testsLocByDatesObj[loc].sort((date_a, date_b)=> date_a-date_b);
                testsLocByDates.push({locName: loc, locData: testsLocByDatesObj[loc]})
            });
            testsLocByDates.sort((loc_a, loc_b)=> loc_a.locName.localeCompare(loc_b.locName));
            

            Object.keys(overallTestsByLocObj).map(loc=>{
                const cities=[];
                Object.keys(overallTestsByLocObj[loc].cities).map(city=>{
                    cities.push({
                            city,
                            ...overallTestsByLocObj[loc].cities[city]
                        });
                });
                cities.sort((city_a, city_b)=>city_a.city.localeCompare(city_b.city));
                cities.sort((city_a, city_b)=>city_b.overallTests-city_a.overallTests);
                cities.sort((city_a, city_b)=>city_b.positives-city_a.positives);
                overallTestsByLocObj[loc].cities=cities;
            });
            return [testsLocByDates, overallTestsByLocObj];
        }

        function getData(citiesArray, week){
            const byDates={};
			const filteredTestsByWeek=tests.filter(test=> getWeekByDate(new Date(test.testDate))===selectedWeek)
			
            //Tests in ci
			const testsInCityLocOrResidance=filteredTestsByWeek.map(test=>{
					let isTestInCitiesLoc;
                    let isResidenceFromCities;
					if (citiesArray.find(city=> city===test.city))
						isResidenceFromCities=true;
                    
                    
                    if (citiesArray.find(city=> test.testLocCity=== cityToJuristiction[city])){
                        isTestInCitiesLoc=true;
                    }
					
					if (!isTestInCitiesLoc && !isResidenceFromCities)
						return null;
                    
					return {
						isTestInCitiesLoc,
						isResidenceFromCities,
						...test
					};
			}).filter(test=>test);
            testsInCityLocOrResidance.forEach((test, index) => {
                const {result, city, testLoc, testDate, isTestInCitiesLoc, isResidenceFromCities, count}=test
                if (!byDates[testDate])
                {
                    byDates[testDate]={
                        positives:0,
                        negatives: 0,
                        processing: 0,
                        disposed: 0,
                        testsInCityByResidances:[],
                        testsInCityByOutsiders:[],
                        testsByResidancesOutOfCity:[],
                        testDate,
                    }
                }

                const {testsInCityByResidances, testsInCityByOutsiders, testsByResidancesOutOfCity}=byDates[testDate];
                if (isTestInCitiesLoc && !isResidenceFromCities)
                    testsInCityByOutsiders.push(test);
                else if (isTestInCitiesLoc && isResidenceFromCities)
                    testsInCityByResidances.push(test);
                else if(!isTestInCitiesLoc && isResidenceFromCities)
                    testsByResidancesOutOfCity.push(test);

                if (isTestInCitiesLoc)
                    switchResults(byDates[testDate], result, count)
            });
            let byDatesArray=[];
            Object.keys(byDates).map(dateName=>{
                byDatesArray.push(byDates[dateName]);
            });
            
            
            byDatesArray=byDatesArray.map(dateData=>{
                const testDate=new Date(dateData.testDate);
                return {
                    testDate_date: testDate,
                    ...dateData
                }
            });
            byDatesArray.sort((dateD1,dateD2)=>dateD1.testDate_date - dateD2.testDate_date);

            reduceTestsByCityAndResidenci(byDatesArray)
            return byDatesArray
        }

        function reduceTestsByCityAndResidenci(byDatesArray){
            byDatesArray.forEach((dateData, index)=>{
                const {testsInCityByOutsiders, testsInCityByResidances, testsByResidancesOutOfCity}=dateData;
                
                const outsidersObj={};
                const cityByResidances={
                    positives: 0,
                    negatives: 0,
                    processing: 0,
                    disposed: 0
                };
                const outsidersResults={
                    positives: 0,
                    negatives: 0,
                    processing: 0,
                    disposed: 0
                };
                const residancesOutOfCityResults={
                    positives: 0,
                    negatives: 0,
                    processing: 0,
                    disposed: 0
                };
                const residancesOutOfCityObj={};
                const residancesOfCiteisAtCityLocObj={};
                testsInCityByOutsiders.forEach(test=>{
                    const {result, city, count}=test;
                    if (!outsidersObj[city])
                        outsidersObj[city]={
                            positives: 0,
                            negatives: 0,
                            processing: 0,
                            disposed: 0
                        }
                    switchResults(outsidersResults, result, count)
                    switchResults(outsidersObj[city], result, count)
                });

                const outsiders=[];
                Object.keys(outsidersObj).map(key=>{
                    const curOutsiders= outsidersObj[key];
                    outsiders.push({
                        city: key,
                        ...curOutsiders
                    });
                });
                outsiders.sort((out1, out2)=>out1.city-out2.city);
                outsiders.sort((out1, out2)=>out2.positives-out1.positives);

                const residancesOutOfCity=[];
                testsByResidancesOutOfCity.forEach(test=>{
                    const {result, testLoc, count, testLocCity}=test;
                    if (!residancesOutOfCityObj[testLoc])
                        residancesOutOfCityObj[testLoc]={
                            positives: 0,
                            negatives: 0,
                            processing: 0,
                            disposed: 0,
                            testLocCity
                        }

                        switchResults(residancesOutOfCityResults, result, count)
                        switchResults(residancesOutOfCityObj[testLoc], result, count)
                });
                Object.keys(residancesOutOfCityObj).map(key=>{
                    const curResOutOf= residancesOutOfCityObj[key];
                    residancesOutOfCity.push({
                        testLoc: key,
                        ...curResOutOf
                    });
                });
                residancesOutOfCity.sort((out1, out2)=>out1.testLoc-out2.testLoc);
                residancesOutOfCity.sort((out1, out2)=>out2.positives-out1.positives);

                const residancesOfCiteisAtCityLoc=[];
                testsInCityByResidances.forEach(test=>{
                    const {result, city, count}=test;
                    if (!residancesOfCiteisAtCityLocObj[city])
                        residancesOfCiteisAtCityLocObj[city]={
                                positives: 0,
                                negatives: 0,
                                processing: 0,
                                disposed: 0
                            }
                    
                    switchResults(cityByResidances, result, count);
                    switchResults(residancesOfCiteisAtCityLocObj[city], result, count)
                });
                Object.keys(residancesOfCiteisAtCityLocObj).map(key=>{
                    const curResOfCity= residancesOfCiteisAtCityLocObj[key];
                    residancesOfCiteisAtCityLoc.push({
                        city: key,
                        ...curResOfCity
                    });
                });
                residancesOfCiteisAtCityLoc.sort((out1, out2)=>out1.city-out2.city);
                residancesOfCiteisAtCityLoc.sort((out1, out2)=>out2.positives-out1.positives);

                byDatesArray[index]={
                    outsiders,
                    cityByResidances,
                    residancesOutOfCity,
                    outsidersResults,
                    residancesOutOfCityResults,
                    residancesOfCiteisAtCityLoc,
                    ...dateData
                }
            })
        }

        function switchResults(obj, result, count){
            switch (result) {
                case SEMI_POSITIVE:
                    obj.positives+=count;
                    break;

                case POSITIVE:
                    obj.positives+=count;
                    break;

                case PROCESSING:
                    obj.processing+=count;
                    break;
                
                case NEGETIVE:
                    obj.negatives+=count;
                    break;

                case DISPOSED:
                    obj.disposed+=count;
                    break;

                default:
                    break;
            }
        }

    function superReduceTestsData(tests){
        const testLocsByWeeks={};
        tests.forEach(test => {
            const {testLocCity, result, testDate, count}=test
            const week = getWeekByDate(new Date(testDate));
            if (!testLocsByWeeks[week])
                testLocsByWeeks[week]={};
            const testLocWeek=testLocsByWeeks[week];
            if (!testLocWeek[testLocCity])
                testLocWeek[testLocCity]={
                    positives: 0,
                    processing: 0,
                    negatives: 0,
                    disposed: 0
                }
            switchResults(testLocWeek[testLocCity], result, count);
        });
        return testLocsByWeeks;
    }
    
    let dashBoardData=[];
    function getDashBoardData(){
        dashBoardData=[];
        const reducedWeekData= superReduceTestsData(tests);
        const citiesData=[];
        const dashBoardCityArray=dashboardCities.split(`\n`).filter(city=>city);
        dashBoardCityArray.forEach(city => {
            dashBoardData.push({

                weekReducedData: reducedWeekData[selectedWeek][city]
            });
        });
        dashBoardData=dashBoardData.filter(data=>data.weekReducedData);
    }
